import { Component, OnInit } from '@angular/core';
import { BranchInfoService } from 'src/app/branch-info.service';
import { BranchWithDep } from 'src/app/shared/branch-with-dep';
import { DepartmentInfo } from 'src/app/shared/department-info.model';
import { ChangeDetectorRef } from '@angular/core';

@Component({
  selector: 'app-branch',
  templateUrl: './branch.component.html',
  styleUrls: ['./branch.component.css']
})
export class BranchComponent implements OnInit {
  constructor(public objs: BranchInfoService, public cdRef: ChangeDetectorRef) {}

  ngOnInit(): void {
    this.objs.getBranchesWithDepartment;

    console.log(this.objs.branchWithDepList)
  }
}
<table class="table table-hover">
  <thead>
      <tr>
          <th scope="col">BranchID</th>
          <th scope="col">Branch Name</th>
          <th scope="col">Department Name</th>
          <th scope="col">View</th>
          <th scope="col">Update</th>
          <th scope="col">Delete</th>
      </tr>
  </thead>
  <tbody>
      <tr *ngFor="let b of objs.branchWithDepList">
          <td>{{b.BranchId}}</td> 
          <td>{{b.BranchName}}</td>
          <td >{{b.DepartmentName}}</td>
          <td>
              <button type="button" id="viewBranch">View</button>
          </td>
          <td>
              <button type="button" id="EditBranch">Edit</button>
          </td>
          <td>
              <button type="button" id="DeleteBranch">Delete</button>
          </td>
      </tr>
  </tbody>
</table>
